import React, { useState } from 'react'

const Rough = () => {
    const[count,setCount] = useState(0);
    const handleAdd =()=>{
        setCount(count+1);
    }
    const handleDelete = ()=>{
        if(count<0){
            setCount(0)
        }
        else{
            setCount(count-1);
        }
    }
  return (
    <div>
        <h1>Counter :{count}</h1>
        <button onClick={handleAdd}>Increment</button>
        <button onClick={handleDelete}>Decrement</button>
    </div>
    
  )
}

export default Rough
